import React, { useState } from 'react';
import axios from 'axios';

export function FormularioEmpreendedor() {
  const [nome, setNome] = useState('');
  const [genero, setGenero] = useState('');
  const [dataNascimento, setDataNascimento] = useState('');
  const [bi, setBi] = useState('');
  const [email, setEmail] = useState('');
  const [endereco, setEndereco] = useState('');
  const [telefone, setTelefone] = useState('');
  const [areaAtuacao, setAreaAtuacao] = useState('');
  const [provinciaId, setProvinciaId] = useState('');
  const [senha, setSenha] = useState('');

  const [isModalSucessoAberto, setIsModalSucessoAberto] = useState(false);
  const [isModalErroAberto, setIsModalErroAberto] = useState(false);

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await axios.post('http://localhost:3001/FormularioEmpreendedor', {
        nome,
        genero,
        dataNascimento,
        bi,
        email,
        endereco,
        telefone,
        areaAtuacao,
        provinciaId,
        senha,
      });

      if (response.status === 201) {
        setIsModalSucessoAberto(true);
      } else {
        setIsModalErroAberto(true);
      }
    } catch (error) {
      setIsModalErroAberto(true);
    }
  };

  const fecharModalSucesso = () => {
    setIsModalSucessoAberto(false);
  };

  const fecharModalErro = () => {
    setIsModalErroAberto(false);
  };

  return (
    <div>
      <form onSubmit={handleSubmit} className="bg-white shadow-md rounded-md p-6">
        <div className="mb-4">
          <label htmlFor="nome" className="block text-gray-700 font-bold mb-2">
            Nome Completo:
          </label>
          <input
            type="text"
            id="nome"
            value={nome}
            onChange={(e) => setNome(e.target.value)}
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
          />
        </div>
        <div className="mb-4">
          <label htmlFor="genero" className="block text-gray-700 font-bold mb-2">
            Género:
          </label>
          <select
            id="genero"
            value={genero}
            onChange={(e) => setGenero(e.target.value)}
            className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
          >
            <option value="">Selecione o género</option>
            <option value="Masculino">Masculino</option>
            <option value="Feminino">Feminino</option>
          </select>
        </div>
        {/* ... Outros campos para Data de Nascimento, BI, Email, Endereço, Telefone, Área de Atuação, Província, Senha ... */}
        <div className="flex items-center justify-center">
          <button
            type="submit"
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus-shadow-outline"
          >
            Registrar
          </button>
        </div>
      </form>

      {/* Modal de Sucesso */}
      <div className={`fixed inset-0 flex items-center justify-center z-50 ${isModalSucessoAberto ? 'block' : 'hidden'}`}>
        <div className="bg-white rounded-md shadow-lg p-6 w-full max-w-md">
          <h2 className="text-green-500 text-lg font-bold mb-4">
            Registro efetuado com sucesso!
          </h2>
          <p className="mb-4">
            Obrigado por se registrar na nossa plataforma.
          </p>
          <button
            onClick={fecharModalSucesso}
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            Fechar
          </button>
        </div>
      </div>

      {/* Modal de Erro */}
      <div className={`fixed inset-0 flex items-center justify-center z-50 ${isModalErroAberto ? 'block' : 'hidden'}`}>
        <div className="bg-white rounded-md shadow-lg p-6 w-full max-w-md">
          <h2 className="text-red-500 text-lg font-bold mb-4">
            Erro no registro!
          </h2>
          <p className="mb-4">
            Ocorreu um erro ao tentar efetuar o registro. Por favor, tente novamente mais tarde.
          </p>
          <button
            onClick={fecharModalErro}
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            Fechar
          </button>
        </div>
      </div>
    </div>
  );
}
